(function(){

var Klass = function(){
	var local = bob();
	this.b = local;
}

var p = Klass.prototype;
	p.propA = "prop A ";
	p.c = "prop B ";
	p.propC = "prop C ";
	p.b = "prop D ";
	
	var locA = "local A ";
	var g = "local B ";
	var locC = "local C ";
	var f = "local D ";
	
	var obj = {
		objA : "object A ",
		e : "object B ",
		objC : "object C ",
		d : "object D "
	}
	
	function a(){
		var objStr = "";
		for(var prop in obj){
			objStr += prop + " : " + obj[prop];
		}
		return locA + g + locC + f + objStr;
	}
	
	function bob(arg){
		return a() + arg;
	}
	
	window.Klass = Klass;
	
})();
